  border-radius: 4px; 
  padding: 0px 2px 0px 2px; 
  opacity: 1; 
}

/* =======================================
   Outliner Plugin
   ======================================= */   
  
[data-type="outline"] {
  /* h1 */
  .tree-item > .tree-item-self {
    color: var(--h1-color);
  }

  /* h2 */
  .tree-item .tree-item > .tree-item-self {
    color: var(--h2-color);
  }

  /* h3 */
  .tree-item .tree-item .tree-item > .tree-item-self {
    color: var(--h3-color);
