using System;
using System.Collections.Generic;

namespace NumbersSum
{
    internal class Program
    {
        static void Main(string[] args)
        {
            List<int> numbers = new List<int>();

            string startupDescriptionMessage = "Программа запоминает введённые вами числа. \nПосчитать сумму всех введённых чисел: sum \nВыход: exit";
            string sumShowingMessage = "Текущая сумма:";
            string numberReadingError = "Не могу прочитать число.";
			string shutdownMessage = "Завершение работы...";

            string command = String.Empty;
            string commandExit = "exit";
            string commandSum = "sum";

            Console.WriteLine(startupDescriptionMessage);

            while (command != commandExit)
            {
                command = Console.ReadLine();

                bool isNumeric = int.TryParse(command, out _);

                if (command == commandSum)
                {
                    int sum = 0;

                    foreach (int number in numbers)
                    {
                        sum += number;
                    }

                    Console.WriteLine(sumShowingMessage + sum);
                }
                else if (isNumeric == true)
                {
                    int userNumber = Convert.ToInt32(command);
                    
                    numbers.Add(userNumber);
                }
                else if (command != commandExit)
                {
                    Console.WriteLine(numberReadingError);
                }
            }

            Console.WriteLine(shutdownMessage);
            Console.ReadLine();
        }
    }
}

