// ==UserScript==
// @name         TTGD Rip Pager
// @version      1
// @description  Makes SG database generate a Template:Rip/Draft2 for the rip
// @author       TurretBot
// @match        https://siivagunnerdatabase.net/rips/*
// @grant        none
// ==/UserScript==

(function() {
    'use strict';

    var description=document.getElementsByTagName("p")[2].innerHTML,
        args=["|music label=","|music=","|composer label=","|composer=","|performer label=","|performer=","|arranger label=","|arranger="],
        template="";

    args=args.slice(0,(description.split("playlist?")[0].split("\n").length-1)*2)
    args.push("|playlist label=","|playlist id=","|platform label=","|platform=");
    if (description.split("list=")[1].split("\n").length & 1) {args.push("|ripper label=","|ripper=");};
    if (description.includes("\n\n")) {args.push("","|catchphrase=");};

    var desclines=description.replaceAll(": ","\n").split("\n");

    for (var i=0;i<desclines.length;i=i+1) {
        template=template+"\n"+((args[i]+desclines[i]).trim());
    }

    template="{{Rip/Draft2\n|link="+window.location.pathname.split('/')[2]
        +"\n|playlist="+document.getElementsByTagName("h2")[0].innerHTML.split(" - ").slice(-1)
        +"\n|upload="+document.getElementsByTagName("p")[0].innerHTML.split(" ").slice(2,5).join(" ").slice(0,-1)
        +"\n|length=\n|author=\n|album=\n|track=\n|artist="+(template
                                                             .replace("\n|music label=Music\n","")
                                                             .replace("\n|composer label=Composer\n","")
                                                             .replace("\n|composer label=Performed by\n|composer=","\n|performer=")
                                                             .replace("\n|composer label=Arranged by\n|composer=","\n|arranger=")
                                                             .replace("\n|performer label=Performed by\n","")
                                                             .replace("\n|performer label=Arranged by\n|performer=","\n|arranger=")
                                                             .replace("\n|arranger label=Arranged by\n","")
                                                             .replace("\n|playlist label=Playlist\n","")
                                                             .replace("https://www.youtube.com/playlist?list=","")
                                                             .replace("\n|platform label=Platform\n","")
                                                             .replace("\n|ripper label=Ripper\n","")
                                                             .replace("\n|catchphrase=Please read the channel description.","")
                                                             .replaceAll("|","\n|"))+"}}\n\"'''"+document.getElementsByTagName("h2")[0].innerHTML+"'''\" is a high quality rip of "+parseSongName(desclines[1])+" from ''"+document.getElementsByTagName("h2")[0].innerHTML.split(" - ").slice(-1)+"''.\n==Joke==\n";
    //alert(template);
    template=template.split(/\r?\n/).filter(line => line.trim() !== '').join('\n').replace("\n}}","}}")+"\n";
    var zNode = document.createElement ('textarea');
    zNode.innerHTML=template;
    document.getElementsByTagName("h2")[0].appendChild(zNode);
    document.getElementsByClassName("gadget")[0].remove();
    window.open(document.getElementsByClassName("smallText")[0].href);
    //chatgpt did this part mostly :o
    function parseSongName(input) {
        var match = input.match(/^(.*?)\s+\(([^)]+)\)$/);
        if (match) {
            var subtitle = match[2].trim();
            if (subtitle.match(/Mix|Version/i)) {
                var output = [];
                for (const word of subtitle.split(/\s+/)) { //preserve any nonstandard capitalization
                    if (word.length > 1 && word === word.charAt(0).toUpperCase() + word.slice(1).toLowerCase()) {
                        output.push(word.toLowerCase());
                    } else {
                        output.push(word);
                    }
                }
                return "the "+output.join(' ')+' of "'+match[1].trim()+'"'
            }
        }
        return '"'+input.trim()+'"';
    }
})();

