+		ThreadPool.scheduleAtFixedRate(new TournamentSearchFights(TournamentFightType.F9X9), 0, Config.TOURNAMENT_TIME_SEARCH_FIGHTS * 1000);
+		VoicedCommandHandler.getInstance().registerHandler(new VoiceTournament());
