+		for (Player player : getMembers())
+		{
+			if (player.getClassId().isHealer())
+			{
+				count++;
+			}
+		}
+		return count;
+		
+	}
+	
+	public int getTankersCount()
+	{
+		int count = 0;
+		for (Player player : getMembers())
+		{
+			if (player.getClassId().isTanker())
+			{
+				count++;
+			}
+		}
