+	
+	public void doRevive()
+	{
+		
+		for (Player player : getMembers())
+		{
+			
+			player.doRevive();
+			player.getStatus().setCpHpMp(player.getStatus().getMaxCp(), player.getStatus().getMaxHp(), player.getStatus().getMaxMp());
+		}
+	}
+	
+	public void disbandTeam()
+	{
