from typeguard import typechecked

@typechecked
class Queue:

    def __init__(self, elementos=[]) -> None:
        self.items = elementos

    @property
    def queue(self):
        return len(self.items)

    @property
    def vacia(self):
        return self.items == []

    def vaciar(self):
        self.items = []

    def encolar(self, elemento):
        self.items.append(elemento)

    def desencolar(self):
        return self.items.pop(0)

    @property
    def frontal(self):
        return self.items[0]

queue1 = Queue([1, 2, 3,4, 5,6 ])
queue2 = Queue()
print(queue2.vacia)
print(queue1.queue)
print(queue1.frontal)
print(queue1.desencolar())
queue1.encolar(1)
print(queue1.queue)

class PilaStack:

    def __init__(self, elementos=[]):
        self.items = elementos

    @property
    def len(self):
        return len(self.items)

    @property
    def interior_pila(self):
        if self.items == []:
            return True
        return False

    @property
    def eliminar_contenido(self):
        self.items = []

    def apilar(self, elemento):
        self.items.insert(0, elemento)

    def desapilar(self):
        if not self.interior_pila:
            return self.items.pop(0)
        else:
            raise IndexError("La pila está vacía, no se puede desapilar.")

    @property
    def top(self):
        if not self.interior_pila:
            return self.items[0]
        return 'Tu pila no tiene elementos.'

mi_pila = PilaStack([1, 2, 3, 4, 5])
print(mi_pila.items)
mi_pila.apilar(6)
print(mi_pila.items)
print('Longitud de la pila :', mi_pila.len)
mi_pila.desapilar()
print(mi_pila.items)
print('Longitud de la pila :', mi_pila.len)
print('Esta vacia la pila:', mi_pila.interior_pila)
print('Valor del top:', mi_pila.top)
mi_pila.eliminar_contenido # Eliminar pila
print('Esta vacia la pila:', mi_pila.interior_pila)

